import React from 'react'
import { NavLink } from 'react-router-dom'
import './Navbar.css'

export default function Navbar() {
  return (
    <div>
        <NavLink exact to='/' style={styles.default} activeStyle={styles.active}>Home</NavLink>
        <NavLink exact to='/login' style={styles.default} activeStyle={styles.active}>Login</NavLink>
        <NavLink exact to='/register' style={styles.default} activeStyle={styles.active}>Register</NavLink>
        <NavLink exact to='/secret' style={styles.default} activeStyle={styles.active}>Secret</NavLink>
    </div>
  );
}

const styles ={
    active:{
        color:'black',
    },
    default: {
        color:'white',
        textDecoration:'none',
    }
}
